--Create database ATBM
--use ATBM
-- XOA KHOA NGOAI
ALTER TABLE PHANCONG DROP CONSTRAINT FK_MANV;
ALTER TABLE PHANCONG DROP CONSTRAINT FK_MADA;
ALTER TABLE NHANVIEN DROP CONSTRAINT FK_PHG;
ALTER TABLE DEAN DROP CONSTRAINT FK_PHONG;
/
delete from NHANVIEN;
drop table NHANVIEN ;
/
CREATE TABLE NHANVIEN
(
	MANV CHAR(6),
	TENNV VARCHAR(40),
	PHAI CHAR(3),
	NGAYSINH DATE,
	DIACHIA VARCHAR(30),
	SODT CHAR(10),
	Luong INT,
	PHUCAP INT,
	VAITRO VARCHAR(20), 
	MANQL CHAR(6),
	PHG CHAR(4),

	constraint PK_NHANVIEN primary key (MANV)
);
/
delete from PHONGBAN;
drop table PHONGBAN;
/
CREATE TABLE PHONGBAN
(
	MAPB CHAR(4),
	TENPB VARCHAR(30),
	TRPHG CHAR(6),
	
	constraint PK_PHONGBAN primary key (MAPB)
);
/
delete from DEAN;
drop table DEAN;
/
CREATE TABLE DEAN
(
	MADA CHAR(6),
	TENDA VARCHAR(30),
	NGAYBD DATE,
	PHONG CHAR(4),

	constraint PK_DEAN primary key (MADA)
)
/
delete from PHANCONG;
drop table PHANCONG;
/
CREATE TABLE PHANCONG
(
	MANV CHAR(6),
	MADA CHAR(6),
	THOIGIAN VARCHAR(10),
	
	constraint PK_PHANCONG primary key (MANV, MADA)
);
/

-- THEM KHOA NGOAI
alter table PHANCONG
 add constraint FK_MANV foreign key (MANV)
references NHANVIEN(MANV);
/
alter table PHANCONG
 add constraint FK_MADA foreign key (MADA)
references DEAN(MADA);
/
alter table NHANVIEN
add constraint FK_PHG foreign key (PHG)
references PHONGBAN(MAPB);
/
alter table DEAN
add constraint FK_PHONG foreign key(PHONG)
references PHONGBAN(MAPB);
/
-- THEM DU LIEU
